import Vue from 'vue'
import VueRouter from 'vue-router'
import Login from '@/views/Login.vue'
import Dashboard from '@/views/Dashboard.vue'
import VersionUpgrade from '@/views/VersionUpgrade.vue'
import ElementQuery from '@/views/ElementQuery.vue'
import TestReport from '@/views/TestReport.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'Login',
    component: Login
  },
  {
    path: '/dashboard',
    name: 'Dashboard',
    component: Dashboard,
    children: [
      {
        path: 'version-upgrade',
        name: 'VersionUpgrade',
        component: VersionUpgrade
      },
      {
        path: 'element-query',
        name: 'ElementQuery',
        component: ElementQuery
      },
      {
        path: 'test-report',
        name: 'TestReport',
        component: TestReport
      }
    ]
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router

console.log('路由配置已加载');
